import { Breadcrumbs, Link } from "@mui/material";
import { useSelector } from "react-redux";

// braedcrum component
function Breadcrum(props: any) {
    const productDetail = useSelector((state: any) => state.getProductList.singleProductDetail);

    return (
        <div className="breadcrum-container">
            <Breadcrumbs>
                <Link>
                    <span className="span-beadcrum"> Clothing</span>
                </Link>
                <Link>
                    {
                        (props.label) ?
                            <span className="span-beadcrum">{props.label ? props.label : productDetail.category}</span> :
                            <span className="span-beadcrum">Dressing</span>
                    }
                </Link>
            </Breadcrumbs>

        </div>
    );
}

export default Breadcrum;
